import { Form, Formik, FormikHelpers } from "formik";
import * as yup from 'yup';
import React from "react";
import TextField from "../../utils/TextField";
import Button from "../../utils/Button";
import { ProjectDto } from "./projects.mode";

interface ProjectFormProps {
    model: ProjectDto
    onSubmit(values: ProjectDto, action: FormikHelpers<ProjectDto>): void;
}

export default function ProjectForm(props: ProjectFormProps) {
    return <>
        <Formik initialValues={props.model}

            onSubmit={props.onSubmit} 
            validationSchema={yup.object({
                name: yup.string().required("This field is required").max(50, "This field can only contain 50 characters")
            })}
        >
            {(formikProps) => (
                < Form >
                    <TextField field="name" displayName="Name" />
                    <Button disabled={formikProps.isSubmitting} type="submit">Save Chagens</Button>
                    <a className="btn btn-secondary" href="/projects">Cancel</a>
                </Form>
            )}

        </Formik >

    </>
}
